import React from 'react';
import ReactDOM from 'react-dom/client';
import App from '../src/components/pages/App.js';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('cabecalho'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const rooot = ReactDOM.createRoot(document.getElementById('cabecalho'));
rooot.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

reportWebVitals();
